import React, {Component} from 'react';
import CardList from './CardList';
import {robots} from './robots';
import Searchbox from './Searchbox';

const state ={
	robots: robots,
	searchfield: ''
}

class App extends Component {
	constructor(){
		super();
		this.state= {
			robots: robots,
			searchfield: ''}
	}
	render(){
		return(
		<div>
		<h1>ROBO Friends</h1>
		<Searchbox/>
		<CardList robots={robots}/>
		</div>
		)
	}
	
}
export default App;
